Version _$VersionFromJson(Map<String, dynamic> json) => Version(
      name: json['name'] as String? ?? '',
      title: json['title'] as String? ?? '',
      msg: json['msg'] as String? ?? '',
      url: json['url'] as String? ?? '',
      testFlight: json['testFlight'] as String? ?? '',
      md: json['md'] as String? ?? '',
      apps: (json['apps'] as List<dynamic>?)
              ?.map((e) => App.fromJson(e as Map<String, dynamic>))
              .toList() ??
          const [],
      version: json['version'] as String? ?? '',
      build: json['build'] as String? ?? '',
      b2v: json['b2v'] as String? ?? '',
      b2: json['b2'] as String? ?? '',
      platform: json['platform'] as String? ?? '',
      isMode: json['isMode'] as bool? ?? false,
      githubs: (json['githubs'] as List<dynamic>?)
              ?.map((e) => e as String)
              .toList() ??
          const [],
      sourceUrl: json['sourceUrl'] as String? ?? "",
      vipjx:
          (json['vipjx'] as List<dynamic>?)?.map((e) => e as String).toList() ??
              const [],
      createAt: json['createAt'] == null
          ? null
          : DateTime.parse(json['createAt'] as String),
      updateAt: json['updateAt'] == null
          ? null
          : DateTime.parse(json['updateAt'] as String),
    );

Map<String, dynamic> _$VersionToJson(Version instance) => <String, dynamic>{
      'name': instance.name,
      'title': instance.title,
      'msg': instance.msg,
      'url': instance.url,
      'testFlight': instance.testFlight,
      'md': instance.md,
      'apps': instance.apps,
      'version': instance.version,
      'build': instance.build,
      'b2v': instance.b2v,
      'b2': instance.b2,
      'platform': instance.platform,
      'isMode': instance.isMode,
      'vipjx': instance.vipjx,
      'githubs': instance.githubs,
      'sourceUrl': instance.sourceUrl,
      'updateAt': instance.updateAt?.toIso8601String(),
      'createAt': instance.createAt?.toIso8601String(),
    };
